import React, { useEffect, useState } from 'react';
import api from '../../services/api';

export default function Home() {
    const [covid, setCovid] = useState([]);

    useEffect(() => {
        const response = api.get();

        setCovid(response.data)
    })
    console.log(covid)
    return(
        <div>
            <div>
                {covid.uid}
            </div>
        </div>
    );
}
